import React from 'react';
import './App.css';
import {ResumeGraphComponent} from './pages/ResumeGraph'
import {HeaderComponent} from './pages/Header';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <HeaderComponent/>
      </header>
      <ResumeGraphComponent />

    </div>
  );
}

export default App;
